#include <iostream>
using namespace std;


int main() {
    string DNA = "";

    string RNA;
    string replacer;
    
    for (int i =0; i < DNA.length(); i++) {
        string replacer;
        
        replacer = DNA[i];
        if (replacer == "T") {
            RNA = RNA + "U";
            
        }
        else {
            RNA = RNA + DNA[i];

        }
        

    }
    cout << RNA;
   }


